declare module '*.scss' {
	const style: string;
	export = style;
}
declare module '@@data/*' {
	const data: any;
	export = data;
}
declare module '@@components/*' {
	const components: any;
	export = components;
}
declare module '@@constants/*' {
	const constants: any;
	export = constants;
}
declare module '@@hooks/*' {
	const hooks: any;
	export = hooks;
}
declare module '@@utils/*' {
	const utils: any;
	export = utils;
}
declare module '@@pages/*' {
	const pages: any;
	export = pages;
}

declare module '@@types/*' {
	const type: any;
	export = type;
}
